const UtilsButton = ({ label, fontColor, width }) => {
  const buttonStyle = {
    width: width,
  };
  return (
    <div>
      <button className="utils-button" style={buttonStyle}>
        <span className="utils-button-text" color={fontColor}>
          {label}
        </span>
      </button>
    </div>
  );
};
export default UtilsButton;
